  // const [resDescription,setResDescription] = useState("");
  // const [resContact,setResContact] = useState("");
  // const [resTimings,setResTimings] = useState("");

  state= {
    restaurantDetails:[]
  };
  componentDidMount(){
      Axios.get("http://localhost:3001/RestaurantLanding.jsx")
      .then((response) => {
           this.setState({restaurantDetails : response.data});
           console.log(response);
      }).catch(err => {
        console.log(err);
      })
    };

  // function showInput() {
  //   document.getElementById('name').innerHTML = document.getElementById("res_name").value;
  //   document.getElementById('location').innerHTML = document.getElementById("res_location").value;
  //   document.getElementById('description').innerHTML = document.getElementById("res_description").value;
  //   document.getElementById('contact').innerHTML = document.getElementById("res_contact").value;
  //   document.getElementById('timings').innerHTML = document.getElementById("res_timings").value;
  // }
render() {
  return(
      <div class="card mb-3">
      {this.state.restaurantDetails.map(restaurantDetail =>{
        <div>
          <img src={restaurantDetail.picture} class="card-img-top" alt="restaurant-img" />
          <div className="card-body">
            <h5 className="card-title">{`${restaurantDetail.name}`}</h5>
            <p className="card-text">{restaurantDetail.location}</p>
            <p className="card-text">{restaurantDetail.description}</p>
            <p className="card-text">{restaurantDetail.contact}</p>
            <p className="card-text"><small class="text-muted">{restaurantDetail.timings}</small></p>
          </div>
        </div>
      })}
      </div>

    );
  }
}


export default Form;
